INSERT INTO `articles` (`id`, `user_id`, `title`, `slug`, `author`, `description`, `thumbnail`, `status`, `views`, `created_at`, `updated_at`, `published_at`) VALUES
(158, 1, 'Revolusi Strategi Servis: Senjata Baru di Setiap Rotasi', 'revolusi-strategi-servis-senjata-baru-di-setiap-rotasi', 'Muhammad Ilham Haekal', 'Analisis mendalam strategi servis voli modern dengan pendekatan teknis, biomekanik, dan adaptasi rotasi', 'thumbnails/1750589096.png', 'Published', 18, '2025-06-22 03:44:57', '2025-07-17 01:42:56', NULL),
(159, 1, 'Mengungkap Pola Rotasi Modern dalam Permainan Voli', 'mengungkap-pola-rotasi-modern-dalam-permainan-voli', 'Muhammad Ilham Haekal', 'Pembahasan mendalam terkait pola rotasi dalam voli modern sebagai strategi tim yang adaptif dan efektif.', 'thumbnails/1750589463.png', 'Published', 20, '2025-06-22 03:51:04', '2025-07-16 08:22:45', NULL),
(160, 1, 'Peran Libero Kini Lebih dari Sekadar Pertahanan', 'peran-libero-kini-lebih-dari-sekadar-pertahanan', 'Muhammad Ilham Haekal', 'Membedah peran libero yang telah berkembang dari sekadar bertahan menjadi penggerak strategi tim dalam permainan voli modern.', 'thumbnails/1750589651.png', 'Published', 29, '2025-06-22 03:54:11', '2025-07-17 20:49:21', NULL),
(161, 1, 'Perjalanan baru Megawati setelah berpisah dari red sparks', 'perjalanan-baru-megawati-setelah-berpisah-dari-red-sparks', 'Agung Dwi Satria', 'Setelah berpisah dari klub lamanya, Megawati menyatakan rasa syukurnya atas langkah baru yang diambil. Ia menyebut bahwa keputusan ini diambil setelah melalui proses pertimbangan matang dan diskusi yang panjang', 'thumbnails/1751652504.png', 'Published', 9, '2025-07-04 11:08:25', '2025-08-19 20:18:12', NULL),
(162, 1, 'Semangat dan Keyakinan Tinggi dari Tim Nasional AVC Nations Cup', 'semangat-dan-keyakinan-tinggi-dari-tim-nasional-avc-nations-cup', 'Agung Dwi Satria', 'Tim nasional voli putra Indonesia menunjukkan rasa percaya diri yang tinggi menjelang pertandingan perempat final AVC Nations Cup 2025. Setelah menjalani fase grup yang cukup menantang, mereka berhasil menampilkan performa terbaik dan memastikan langkah mereka ke babak berikutnya', 'thumbnails/1751652656.png', 'Published', 8, '2025-07-04 11:10:56', '2025-07-18 11:33:26', NULL),
(163, 1, 'Signifikansi Pertandingan Melawan Australia AVC Nations Cup 2025', 'signifikansi-pertandingan-melawan-australia-avc-nations-cup-2025', 'Agung Dwi Satria', 'Pertandingan melawan Australia memiliki makna penting bagi kedua tim. Bagi Indonesia, ini merupakan kesempatan untuk memperbaiki posisi mereka di klasemen akhir setelah sebelumnya menghadapi berbagai tantangan di babak penyisihan dan babak gugur', 'thumbnails/1751652779.png', 'Published', 9, '2025-07-04 11:13:00', '2025-07-18 03:41:40', NULL),
(164, 1, 'Persiapan Timnas Voli Indonesia Menuju SEA V League 2025', 'persiapan-timnas-voli-indonesia-menuju-sea-v-league-2025', 'Agung Dwi Satria', 'Menjelang kompetisi SEA V League 2025, tim nasional voli putra Indonesia semakin menunjukkan keseriusannya dalam mempersiapkan skuad terbaik. Turnamen ini menjadi salah satu agenda penting untuk mengukur kekuatan dan kesiapan tim dalam memperebutkan posisi terbaik di tingkat regional', 'thumbnails/1751908959.png', 'Published', 1, '2025-07-07 10:22:40', '2025-07-12 23:38:08', NULL),
(165, 1, 'resmi nya Megawati hangesti menjadi pemain klub bola voli Turki Manisa BBSK', 'resmi-nya-megawati-hangesti-menjadi-pemain-klub-bola-voli-turki-manisa-bbsk', 'Agung Dwi Satria', 'Megawati Hangestri Pertiwi, bintang voli Indonesia, resmi bergabung dengan klub Turki Manisa BBSK untuk musim 2025–2026, menandai langkah besar dalam karier internasionalnya di liga voli Eropa yang kompetitif', 'thumbnails/1751909276.png', 'Published', 2, '2025-07-07 10:27:57', '2025-07-12 22:03:15', NULL),
(166, 1, 'Pernikahan Dio Novandra, atlet Finswimming yang menikah dengan megawati Hangestri', 'pernikahan-dio-novandra-atlet-finswimming-yang-menikah-dengan-megawati-hangestri', 'Agung Dwi Satria', 'Megawati Hangestri, bintang voli Indonesia, resmi menikah dengan atlet finswimming Dio Novandra dalam momen sakral yang memperkuat citranya sebagai sosok inspiratif di dalam dan luar lapangan.', 'thumbnails/1751910133.png', 'Published', 3, '2025-07-07 10:42:14', '2025-10-08 02:28:32', NULL),
(167, 1, 'Panduan Jitu Menguasai Teknik Voli untuk Pemula: Langkah Awal Jadi Jagoan Lapangan!', 'panduan-jitu-menguasai-teknik-voli-untuk-pemula-langkah-awal-jadi-jagoan-lapangan', 'salsa', 'Teknik dasar bola voli yang penting bagi pemain pemula, seperti servis, passing, blocking, dan smash. Juga pentingnya kerja sama tim serta latihan rutin untuk meningkatkan keterampilan secara bertahap.', 'thumbnails/1751997187.png', 'Published', 5, '2025-07-08 10:53:08', '2025-07-16 08:22:44', NULL),
(168, 1, 'Lika-liku Timnas Voli Indonesia di AVC 2025: Peluang Bangkit Usai Tumbang dari Australia.', 'lika-liku-timnas-voli-indonesia-di-avc-2025-peluang-bangkit-usai-tumbang-dari-australia', 'salsa', 'Performa tim voli putra nasional di ajang AVC Nations Cup 2025, di mana mereka harus puas menempati posisi keenam usai dikalahkan oleh Australia dengan skor 0–3.', 'thumbnails/1751997340.png', 'Published', 6, '2025-07-08 10:55:41', '2025-07-16 08:22:43', NULL),
(169, 1, 'Belajar Voli dari Nol: Teknik Dasar yang Harus Kamu Kuasai Biar Nggak Kaku di Lapangan', 'belajar-voli-dari-nol-teknik-dasar-yang-harus-kamu-kuasai-biar-nggak-kaku-di-lapangan', 'salsa', 'Teknik dasar bola voli yang wajib dipelajari pemula: servis, passing bawah & atas, smash, blocking, digging, setting, rotasi, footwork, positioning, dan komunikasi. Penjelasan setiap teknik disajikan langkah demi langkah dan dilengkapi tips latihan rutin agar keterampilan berkembang secara menyeluruh', 'thumbnails/1751997479.png', 'Published', 5, '2025-07-08 10:58:00', '2025-07-16 08:22:43', NULL),
(170, 1, 'Voli Gemilang: Menguasai Lapangan, Mengukir Kisah', 'voli-gemilang-menguasai-lapangan-mengukir-kisah', 'salsa', 'Teknik dasar bola voli yang wajib dipelajari pemula: servis, passing bawah & atas, smash, blocking, digging, setting, rotasi, footwork, positioning, dan komunikasi. Penjelasan setiap teknik disajikan langkah demi langkah dan dilengkapi tips latihan rutin agar keterampilan berkembang secara menyeluruh', 'thumbnails/1752427448.png', 'Published', 5, '2025-07-13 10:24:09', '2025-07-18 09:37:23', NULL),
(171, 1, 'Baru Mulai Main Voli? Ini 4 Teknik Dasar yang Harus Kamu Kuasai Dulu!', 'baru-mulai-main-voli-ini-4-teknik-dasar-yang-harus-kamu-kuasai-dulu', 'salsa', 'Empat teknik dasar bola voli yang krusial untuk dipelajari pemula, yaitu passing, smash, blok, dan servis. Penjelasannya disajikan secara ringkas dan praktis, dimulai dari posisi tubuh dasar, cara gerakan, hingga tujuan masing-masing teknik dalam mendukung strategi tim', 'thumbnails/1752427714.png', 'Published', 4, '2025-07-13 10:28:35', '2025-07-18 03:03:33', NULL),
(172, 1, 'Misi Penentuan: Harapan Terakhir Timnas Voli di Ajang Internasional', 'misi-penentuan-harapan-terakhir-timnas-voli-di-ajang-internasional', 'salsa', 'Tim voli putra nasional gagal lolos ke semifinal ajang AVC Nations Cup 2025 dan kini hanya memiliki satu kesempatan tersisa—yaitu laga perebutan posisi kelima—sebagai upaya untuk melewati prestasi terbaik mereka dua tahun sebelumnya', 'thumbnails/1752428019.png', 'Published', 7, '2025-07-13 10:33:40', '2025-07-18 02:20:09', NULL),
(173, 1, 'Gairahkan Ekonomi Lokal, Turnamen Voli Ini Sekaligus Angkat UMKM', 'gairahkan-ekonomi-lokal-turnamen-voli-ini-sekaligus-angkat-umkm', 'salsa', 'Turnamen voli bernama Danlanudad Cup berhasil menjadi media efektif untuk promosi produk pelaku usaha kecil, dengan stan-stan UKM ikut serta menampilkan barang dagangan mereka selama pertandingan dan menarik perhatian penonton serta peserta acara', 'thumbnails/1752861748.png', 'Published', 0, '2025-07-18 11:02:29', '2025-07-18 11:02:29', NULL),
(174, 1, '312', '312', '132', '213', 'thumbnails/1752870083.png', 'Draft', 0, '2025-07-18 13:21:25', '2025-07-18 13:21:25', NULL);
