INSERT INTO `tournament_rules` (`id`, `tournament_id`, `rule_text`, `created_at`, `updated_at`) VALUES
(49, 8, 'PERATURAN KHUSUS : Jumlah pemain 12 orang termasuk cadangan dan libero Setiap tim diperkenankan maksimal 6 kali pergantian pemain dalam 1 set. Setiap tim diperkenankan maks 2 kali time out dalam 1 set pertandingan dan ditambah dengan technical time out (tto) yang berlaku secara otomatis pada saat tim unggul mencapai poin 8 dan 16 (waktu time out adalah 30 detik).Setiap pertandingan menggunakan system gugur dan di mainkan dengan sistem 2 kali kemenangan (two winning set) pada babak penyisihan, sedangkan pada babak semifinal dan final dimainkan dengan sistem 3 kali kemenangan (three wining set). Apabila terjadi skor 1-1 atau 2-2 maka diadakan set penentuan dengan point kemenangan sampai 15. Peraturan pertandingan ini mengacu kepada peraturan PBVSI tahun 2015 dengan sistem rally point yang berakhir pada point 25, jika terjadi point sama 24-24 akan diadakan deuce untuk mencari kemenangan dengan selisih 2 angka. Apabila 1 tim setelah di panggil 3X untuk bermain dengan interval 5 menit tidak hadir dilapangan pertan', '2025-06-22 23:25:32', '2025-06-22 23:25:32'),
